function getPrice(ves, obem, cur){
var post_price=0;
	if (ves/obem< cur.data2) {
		if (obem>=15) post_price=cur.data10;
		else if (obem<15 && obem>=7.5) post_price=cur.data11;
		else if (obem<7.5 && obem>=4) post_price=cur.data12;
		else if (obem<4 && obem>=1.5) post_price=cur.data13;
		else if (obem<1.5 && obem>=0.5) post_price=cur.data14;
		else if (obem<0.5) post_price=cur.data15;
		post_price=post_price*obem;
	}
	else {
		if (ves>=3000) post_price=cur.data4;
		else if (ves<3000 && ves>=1500) post_price=cur.data5;
		else if (ves<1500 && ves>=800) post_price=cur.data6;
		else if (ves<800 && ves>=300) post_price=cur.data7;
		else if (ves<300 && ves>=100) post_price=cur.data8;
		else if (ves<100) post_price=cur.data9;
		post_price=post_price*ves;
	};
	return post_price;
};
