function checkNegabarit(ves,obem,checked){
	var res;
	if (obem>0 && ves>0)
		if(obem>2||ves>=500||checked) {	
			$(".info").text("Негабаритная перевозка");
			if (!checked) $("#negabarit").prop( "checked", true );
			if (ves>=500&&ves<2500) res=0.2;
			else if (ves>2500) res=0.5;
			else if (ves<500&&obem>2) res=0.2;
		}
		else res=0;
	return res;
};

